settings.markerImageFunction:
var deviceTemp = dsData[dsIndex]['temperature'];
var deviceType = dsData[dsIndex]['aType'];
var assetType = dsData[dsIndex]['aType'];
var alarmsCount = dsData[dsIndex]['alarmsCount'];
var alarmsCountCriticalUnack = dsData[dsIndex]['alarmsCountCriticalUnack'];
var alarmsCountCriticalAck = dsData[dsIndex]['alarmsCountCriticalAck'];
var alarmsCountMajorUnack = dsData[dsIndex]['alarmsCountMajorUnack'];
var alarmsCountMajorAck = dsData[dsIndex]['alarmsCountMajorAck'];
var res = {
	    url: images[1],
	    size: 30
};

// --- Alarm Markers applicableble to all devices---
// 
// if alarm Critical unAck 
if (alarmsCountCriticalUnack > 0)
{       res.size = 30;
	    res.url = images[0];
}
// if alarm Critical Ack
if (alarmsCountCriticalAck > 0 && alarmsCountCriticalUnack === 0 && alarmsCountMajorUnack === 0)
{       res.size = 30;
	    res.url = images[1];
}
// if alarm Major UnAck
if (alarmsCountMajorUnack > 0 && alarmsCountCriticalUnack === 0)
{       res.size = 30;
	    res.url = images[2];
}
// if alarm Major Ack  
if (alarmsCountMajorAck > 0 && alarmsCountCriticalUnack === 0 && alarmsCountMajorUnack === 0 && alarmsCountCriticalAck === 0)
{       res.size = 30;
	    res.url = images[3];
}


// Gateway Alarms Count triggers Marker
//  if (deviceType == "gateway" && alarmsCount === 0)
if (deviceType == "gateway" && alarmsCount !== 0)
{       res.size = 30;
	    res.url = images[0];
}
// 
// --- Individual Markers per type without alarms --- 
//
// Device gateway & no alarms
//  if (deviceType == "gateway" && alarmsCount === 0)
if (deviceType == "gateway" && alarmsCount === 0)
{       res.size = 30;
	    res.url = images[4];
}
// Device temp-sensor & no alarm
if (deviceType == "thermostat" && alarmsCount === 0)
{       res.size = 30;
	    res.url = images[5];
}
// Device air-pressure & no alarm
if (deviceType == "air-pressure" && alarmsCount === 0)
{       res.size = 30;
	    res.url = images[7];
}
// Device air-quality & no alarm
if (deviceType == "air-quality" && alarmsCount === 0)
{       res.size = 30;
	    res.url = images[8];
}
// Asset door & no active alarm
//  if (assetType == "door" && no alarm)
if (assetType == "door" & alarmsCount === 0)
{       res.size = 30;
	    res.url = images[6];
}
// Diff Pressure & no active alarm
//  if (assetType == "diffPressure" && no alarm)
if (deviceType == "diffPressure" & alarmsCount === 0)
{       res.size = 30;
	    res.url = images[6];
}
// Asset cabinet & no alarm
if (assetType == "cabinet" && alarmsCount === 0)
{       res.size = 30;
	    res.url = images[9];
}
return res;

